import React, { Component } from 'react';

class Box extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div 
                id={this.props._id} 
                className={"Box bg-white"}
                height={'50px'}
                width={'50px'}
            >

            </div>
        );
    }
}
